import React, { Fragment, useEffect, useState } from 'react'
import { Table } from 'react-bootstrap'
import axios from 'axios'


export const Home = () => {
    const [user, setUser] = useState({})

    

   useEffect(()=>{

       axios.get('http://localhost:8080/api/data/1').then((res)=>{
           
           console.log(res.data);
           setUser(res.data)
        });
        
    }, [setUser])

   console.log(user);
    // const { data } = res
    // const  { users, metrics } = data;



    
    return (
        <div>
            &nbsp;
            <h1 style={{ textAlign: "center" }}>Usarios</h1>
            <Table className='table' striped>
                &nbsp; &nbsp; &nbsp; &nbsp;
                <thead>
                    <tr>
                        <th>
                            ID
                        </th>
                        <th>
                            Nombre
                        </th>
                        <th>
                            Metrica
                        </th>
                        <th>
                            Username
                        </th>
                    </tr>
                </thead>
                <tbody>
                    {
                        user == {} ?
                        user.map( usuario => (
                            <Fragment>
                            <tr>
                                <th scope="row">
                                    {usuario.id}
                                </th>
                                
                            </tr>
                            </Fragment>
                        ))
                        :
                        <Fragment></Fragment>
                
                    }   
                </tbody>
            </Table>

        </div >

    )
}

export default Home
